import React from 'react';
const Header: React.FC = () => (
    <header style={{ 
      backgroundColor: 'green', 
      color: 'white', 
      textAlign: 'center', 
      padding: '1em',
      fontSize: '32px'
       }}>
      <h1>POCKET PROFESSOR</h1>
    </header>
  );
  
  export default Header;
